import React, { useEffect } from 'react';
import './App.css';
import Header from './components/Header';
import HeroSection from './components/HeroSection';
import ProblemStatement from './components/ProblemStatement';
// import Features from './components/Features';
import HowItWorks from './components/HowItWorks';
import SubscriptionPlans from './components/SubscriptionPlans';
import DailyMenu from './components/DailyMenu';
import Testimonials from './components/Testimonials';
import DeliveryMap from './components/DeliveryMap';
import FAQ from './components/FAQ';
import Footer from './components/Footer';
import ErrorBoundary from './components/ErrorBoundary';
import { createScrollObserver } from './lib/utils';

function App() {
  useEffect(() => {
    // Mark document as JS-enabled for CSS transitions
    document.body.classList.add('js-enabled');

    let intersectionObserver = null;
    let mutationObserver = null;
    let debounceTimer = null;

    const initializeScrollObserver = () => {
      // Cleanup existing observer
      if (intersectionObserver) {
        intersectionObserver.disconnect();
      }

      // Create optimized intersection observer for fade-in animations
      intersectionObserver = createScrollObserver((entries) => {
        // Debounce to reduce frequency of calls
        if (debounceTimer) {
          clearTimeout(debounceTimer);
        }

        debounceTimer = setTimeout(() => {
          entries.forEach(entry => {
            if (entry.isIntersecting) {
              // Use requestAnimationFrame for smooth updates
              requestAnimationFrame(() => {
                entry.target.classList.add('active');
                // Unobserve after activating to improve performance
                intersectionObserver.unobserve(entry.target);
              });
            }
          });
        }, 16); // ~60fps debounce
      }, { 
        threshold: 0.1, // Increased threshold for fewer callbacks
        rootMargin: '50px 0px' // Trigger animations earlier for smoother experience
      });

      // Apply to existing .section-fade elements
      const fadeElements = document.querySelectorAll('.section-fade');
      fadeElements.forEach(section => {
        if (section && !section.classList.contains('active')) {
          intersectionObserver.observe(section);
        }
      });
    };

    // Initialize scroll observer immediately
    initializeScrollObserver();

    // Optimized MutationObserver setup
    const setupMutationObserver = () => {
      mutationObserver = new MutationObserver((mutations) => {
        let hasNewFadeElements = false;
        let newElements = [];

        mutations.forEach((mutation) => {
          mutation.addedNodes.forEach((node) => {
            if (node.nodeType === Node.ELEMENT_NODE) {
              // Check if the added node itself has the class
              if (node.classList && node.classList.contains('section-fade')) {
                newElements.push(node);
                hasNewFadeElements = true;
              }

              // Check if any child elements have the class
              const childFadeElements = node.querySelectorAll && node.querySelectorAll('.section-fade');
              if (childFadeElements && childFadeElements.length > 0) {
                newElements.push(...childFadeElements);
                hasNewFadeElements = true;
              }
            }
          });
        });

        // Batch process new elements
        if (hasNewFadeElements && intersectionObserver) {
          requestAnimationFrame(() => {
            newElements.forEach(element => {
              if (!element.classList.contains('active')) {
                intersectionObserver.observe(element);
              }
            });
          });
        }
      });

      // Start observing the document for changes
      mutationObserver.observe(document.body, {
        childList: true,
        subtree: true,
        attributes: false
      });
    };

    // Setup mutation observer after initial render
    setTimeout(setupMutationObserver, 100);

    // Cleanup function
    return () => {
      if (intersectionObserver) {
        intersectionObserver.disconnect();
      }
      if (mutationObserver) {
        mutationObserver.disconnect();
      }
      if (debounceTimer) {
        clearTimeout(debounceTimer);
      }
    };
  }, []);

  return (
    <div className="font-sans text-gray-800 bg-white overflow-x-hidden min-h-screen scroll-optimized">
      <ErrorBoundary>
        <Header />
      </ErrorBoundary>

      <main className="relative scroll-optimized-child">
        <ErrorBoundary>
          <HeroSection />
        </ErrorBoundary>

        <ErrorBoundary>
          <ProblemStatement />
        </ErrorBoundary>

        {/* <Features /> */}

        <ErrorBoundary>
          <DailyMenu />
        </ErrorBoundary>

        <ErrorBoundary>
          <SubscriptionPlans />
        </ErrorBoundary>

        <ErrorBoundary>
          <HowItWorks />
        </ErrorBoundary>

        <ErrorBoundary>
          <Testimonials />
        </ErrorBoundary>

        <ErrorBoundary>
          <DeliveryMap />
        </ErrorBoundary>

        <ErrorBoundary>
          <FAQ />
        </ErrorBoundary>
      </main>

      <ErrorBoundary>
        <Footer />
      </ErrorBoundary>
    </div>
  );
}

export default App;
